let entity, entityName, vibration, lastUpdate,
    batteryLevel, temperature, temperatureColor, isTemperatureThreshold, lowBatteryColor,
    isLowBattery, isActive, sensorStatus, statusColor, statusBgColor, entityLabel;

if (data.length) {
    entity = data[0];
    entityName = entity.entityName;
    entityLabel = entity.entityLabel;
    temperature = processValue(entity.temperature, 0) + "Â°C";
    isTemperatureThreshold = entity.isHighTemperature || entity.isLowTemperature;
    temperatureColor = isTemperatureThreshold ? '#D12730' : '#29313C';                   
    vibration = entity.vibration;
    batteryLevel = processValue(entity.battery, 0) + '%';
    isLowBattery = entity.isLowBattery;
    lowBatteryColor = isLowBattery ? '#D12730' : '#29313C';
    isActive = entity.active === 'true';
    sensorStatus = isActive ? 'Online' : 'Offline';
    statusColor = isActive ? '#3AA94D' : '#C42F37';
    statusBgColor = isActive ? 'rgba(58, 169, 77, 0.08)' : 'rgba(196, 47, 55, 0.08)';
    lastUpdate = (entity['battery|ts'] || entity['temperature|ts']) ?
        moment(Math.max(entity['battery|ts'], entity['temperature|ts'])).format('D MMM YYYY HH:mm') : '-';

} else {
    entityName = '-';
    lastUpdate = '-';
    batteryLevel = '-';
    isLowBattery = false;
    isTemperatureThreshold = false;
    temperature = '-';
    vibration = '-';
    temperatureColor = '#29313C';
    lowBatteryColor = '#29313C';
    isActive = false;
    sensorStatus = 'Offline';
    statusColor = '#C42F37';
    statusBgColor = 'rgba(196, 47, 55, 0.08)';
}

return  '<div class="tank-details" fxLayout="column">' +     
            '<div class="tank-details-header">' + `${entityLabel}` + '</div>' +
            '<div class="tank-details-container" fxLayout="column">' +
                // '<div class="tank-details-row" fxFlex  fxLayoutAlign="space-between strech">' +
                //     '<div class="label">Serial number</div>' +
                //     '<div class="value">'+ entityName +'</div>' +
                // '</div>' +
                '<div class="tank-details-row" fxFlex  fxLayoutAlign="space-between strech">' +
                    '<div class="label">Vibration</div>' +
                    '<div class="value">'+ vibration +'</div>' +
                '</div>' +
                '<div fxFlex class="tank-details-row" fxLayoutAlign="space-between strech">' +
                    '<div class="label">Container temperature</div>' +
                    '<div class="value" style="color:'+ temperatureColor +'">'+ temperature +'</div>' +
                '</div>' +
                '<div fxFlex class="tank-details-row" fxLayoutAlign="space-between strech">' +
                    '<div class="label">Battery level</div>' +
                    '<div class="value" style="color:'+ lowBatteryColor +'">'+ batteryLevel +'</div>' +
                '</div>' +
                '<div fxFlex class="tank-details-row" fxLayoutAlign="space-between strech">' +
                    '<div class="label">Connection</div>' +
                    '<div class="tank-details-status" style="color:'+ statusColor +';background-color:'+ statusBgColor +'">' + sensorStatus + 
                    '</div>' +
                '</div>' +
                '<div fxFlex class="tank-details-row" fxLayoutAlign="space-between strech">' +
                    '<div class="label">Last update</div>' +
                    '<div class="value" style="border-bottom:none;">'+ lastUpdate +'</div>' +
                '</div>' +
            '</div>' + 
        '</div>';


function isNumber(value) {
    return (typeof value === 'number' && isFinite(value));
}

function processValue(value, dec) {
    value = parseFloat(value);
    if (isNumber(value)) {
        if (isNumber(dec)) {
            value = parseFloat(value.toFixed(dec));
        }
        return value;
    } else {
        return '-';
    }
}

